import {
    ADD_CONTACT,
    DELETE_CONTACT,
    SET_CURRENT,
    CLEAR_CURRENT,
    FILTER_CONTACTS,
    CLEAR_FILTER,
    UPDATE_CONTACT
} from '../types';

export default (state, action) => {
    switch(action.type) {
        default:
            return state;   
    }
}
